  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116064 includes biological,
  chemical, discrete sample, physical and profile data collected from NATHANIEL B.
  PALMER in the Arctic Ocean, Beaufort Sea and Bering Sea from 2003-07-05 to 2003-08-20
  and retrieved during cruise CARINA_320620030705. These data include AMMONIUM, CHLOROPHYLL
  A, Chromophoric Dissolved Organic Matter (CDOM), DISSOLVED ORGANIC CARBON, DISSOLVED
  OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHAEOPHYTIN, PHOSPHATE,
  PHOTOSYNTHETIC ACTIVE RADIATION (PAR), Potential temperature (theta), SALINITY,
  SILICATE, UREA and WATER TEMPERATURE. The instruments used to collect these data
  include CTD, PAR Sensor and bottle. These data were collected by James Swift of
  Scripps Institution of Oceanography and L. Codispoti of University of Maryland;
  Center for Environmental Science; Horn Point Laboratory as part of the CARINA/320620030705
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
